

class Solution:
    # @param s, an input string
    # @param p, a pattern string
    # @return a boolean
    def isMatch(self, s, p):
        d = [[False for j in range(len(p) + 1)] for i in range(len(s) + 1)]
        d[0][0] = True
        for j in range(len(p)):
            if p[j] == '*':
                d[0][j + 1] = d[0][j]

        for i in range(len(s)):
            for j in range(len(p)):
                if s[i] == p[j] or p[j] == '?':
                    d[i + 1][j + 1] = d[i][j]
                elif p[j] == '*':
                    d[i + 1][j + 1] = d[i][j] or d[i + 1][j] or d[i][j + 1]

        return d[len(s)][len(p)]

        
if __name__ == "__main__":
    s = Solution()

    '''
    assert s.isMatch('aa', 'a') == False
    assert s.isMatch('aa', 'aa') == True
    assert s.isMatch('aaa', 'aa') == False
    assert s.isMatch('aa', '*') == True
    assert s.isMatch('aa', 'a*') == True
    assert s.isMatch('ab', '?*') == True
    assert s.isMatch('aab', 'c*a*b') == False
    '''

    assert s.isMatch("", "**") == True

